INSERT INTO `therapy` VALUES (1,50,'speech','The child\'s ability to communicate well with his surroundings is very important to his quality of life. The goal of the Department of Speech and Communication Therapy is to help children The patients are able to use language, speech or any other method of communication in accordance with his age, abilities and needs. Children and teenagers Those suffering from neonatal infections, developmental problems or acquired injuries, go through the first stage of a diagnosis that concerns For the domains of language, speech, eating and swallowing performance, and subsequently identifying a treatment program appropriate to the child\'s strengths and weaknesses. This clinic is for children (18 months - 18 years) who suffer from communication and language disorders'),(2,50,'musical','It is a psycho-sensory therapy in which music is used as a therapy or a tool through which communication between the child and the therapist takes place. Relies A music therapist specializing in the use and incorporation of music into psychotherapy courses and theories. This type of treatment Suitable for children with special needs of all ages such as children with autism, learning difficulties, Behavioral and social problems or those who suffer from psychological stress.'),(3,50,'occupational','Occupational therapy staff are concerned with improving the independence of the child’s performance with the aim of providing tools and skills that enable the child to cope To life\'s requirements. This area provides support to enable the patient to develop and restore social skills, play skills And learning capabilities in line with his age. One of the primary goals of pediatric occupational therapy is child access Operative therapy diagnoses the child and then adapts a treatment program to the extent possible. Of its own. Treatment includes sensory, motor, and mental and behavioral components.'),(4,50,'behavioral','Based on affirmation and reinforcement, programs are developed that cover all aspects of a child\'s life, starting with the simplest skills such as holding a spoon Food or toothbrushing to writing and preparing for an advanced age, such as the youth stage for young men or women to get a job Commensurate with their needs The system does not include only overcoming the bad side, as it is customary and common (such as reducing fits Shouting, head banging, or other behaviors need intervention and modification) but it includes reinforcing positive behaviors and helps Acquire it and at the same time acquire new skills.');
/*!40000 ALTER TABLE `therapy` ENABLE KEYS */;
